import React from "react";

const PlayerScore = ({ name, score }) => {
    return (
        <>
            <h2>High Scores: {name}</h2>
            <table>
            <tbody>
              {scores.map((score, index) => {
                return (
                  <tr key={index}>
                    <td>{score.n}</td>
                    <td>{score.s}</td>
                  </tr>
                );
                })}
            </tbody>
            </table>
        </>
    )
}

export default PlayerScore;
